import React from 'react';
import ReactDOM from 'react-dom';
import './CSS/index.css';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';
import App from './App';



ReactDOM.render(
  <React.StrictMode>   
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

ReactDOM.render(
  <BrowserRouter>
      <App />
  </BrowserRouter>, 
  document.getElementById('root'));


reportWebVitals();
